DROP TABLE IF EXISTS earthquakes_2016;
CREATE TABLE IF NOT EXISTS earthquakes_2016(
   Date                       DATE  NOT NULL,
   Time                       VARCHAR(8) NOT NULL,
   Latitude                   NUMERIC(10,7) NOT NULL,
   Longitude                  NUMERIC(12,7) NOT NULL,
   Depth                      NUMERIC(6,3) NOT NULL,
   Magnitude                  NUMERIC(4,2) NOT NULL,
   Horizontal_Distance        NUMERIC(6,3),
   ID                         VARCHAR(10) NOT NULL PRIMARY KEY,
   Source                     VARCHAR(2) NOT NULL
);
